            gdView.RefreshDataSource();
        }

        void LoadDetailInFile(DataTable dt)
        {
          gdViewDetail.DataSource = null;
            gridView2.Columns.Clear();
            gdViewDetail.DataSource = dt;
          
            gdViewDetail.RefreshDataSource();
            gdViewDetail.Refresh();
        }

