        void SetupHeader(DataTable dt)
        {
            if (dt != null && dt.Rows.Count > 0)
            {
                browseFolder = dt.Rows[0]["ImportFolder"].ToString();
                txtImportFolder.Text = dt.Rows[0]["ImportFolder"].ToString();
                txtBackupFolder.Text = dt.Rows[0]["BackUpFolder"].ToString();
                txtLogFolder.Text = dt.Rows[0]["LogFolder"].ToString();
                txtOutputFolder.Text = dt.Rows[0]["OutputFolder"].ToString();
                //  lblSourceName.Text = dt.Rows[0]["ReportName"].ToString();
                //  txtReport.Text = string.Format("{0}{1}", dt.Rows[0]["ReportName"].ToString()
                //   , dt.Rows[0]["Desc"].ToString());
            }
            else
            {
                browseFolder = string.Empty;
                txtImportFolder.Text = string.Empty;
                txtBackupFolder.Text = string.Empty;
                txtLogFolder.Text = string.Empty;
                txtOutputFolder.Text = string.Empty;
